import logo from './logo.svg';
import './App.css';
import { BrowserRouter, Switch, Route } from 'react-router-dom';
import Index from './Components/index_page/Index';


function App() {
  return (
    <div>
      <BrowserRouter>
        <Switch>
          <Route path="/info"></Route>
        </Switch>
      </BrowserRouter>
    </div>
  );
}

export default App;
